import DefaultLayout from '@layout/default'
import Link from 'next/Link'

export default function PostLayout(props) {
    return (
        <DefaultLayout>
            <article>
    <h1>{props.title}</h1>
    <div dangerouslySetInnerHTML={{__html:props.content}} />
    <div><Link href="/blog"><a>Home</a></Link></div>
            </article>
        </DefaultLayout>
    )
}
